"use client";

import { cn } from "@/lib/utils";

interface ShieldProps {
  size?: "xs" | "sm" | "md" | "lg" | "xl";
  className?: string;
  fillColor?: string;
  strokeColor?: string;
  gradient?: boolean;
  gradientId?: string;
  width?: number;
  height?: number;
}

export function Shield({ width, height }: ShieldProps) {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      version="1.1"
      width={width}
      height={height}
      viewBox="0 0 60 60"
    >
      <image
        width={width}
        height={height}
        xlinkHref="data:image/png;base64,"
      />
      <style
        dangerouslySetInnerHTML={{
          __html:
            "@media (prefers-color-scheme: light) { :root { filter: none; } }\n@media (prefers-color-scheme: dark) { :root { filter: none; } }\n",
        }}
      />
    </svg>
  );
}

// Export a variant with document overlay for the logo
export function ShieldWithDocument({
  size = "md",
  className,
  documentClassName,
}: {
  size?: "xs" | "sm" | "md" | "lg" | "xl";
  className?: string;
  documentClassName?: string;
}) {
  const documentSizeConfig = {
    xs: "h-2 w-1.5",
    sm: "h-2.5 w-1.5",
    md: "h-3 w-2",
    lg: "h-3.5 w-2.5",
    xl: "h-4 w-3",
  };

  return (
    <div className={cn("relative inline-block", className)}>
      <Shield size={size} />
      <div
        className={cn(
          "absolute inset-0 flex items-center justify-center",
          documentClassName
        )}
      >
        <div className={cn("bg-white rounded-sm", documentSizeConfig[size])} />
      </div>
    </div>
  );
}
